import React from "react";
import GameCard from "./GameCard";

function GameContainer({gameData, gameToFilter, setGameToFilter}) {
    const gameArray = gameData.map((game) => {
        return(
            <GameCard 
            game={game} 
            key={game.name} gameToFilter={gameToFilter} setGameToFilter={setGameToFilter}/>
        )
    })
    return (
        <div>
            {gameArray}
        </div>
    )
}

export default GameContainer;
